  {name: "Foster Hamill", email: "benton_mitchell@cummerata.biz", session_token: "cuhRagf5UJCZQIfVuaGpWw", password_digest: "$2a$10$fIOP.maSwRd5p5mlPj/5buwuO6ZS0dc/l9twbzr39UcNJnYmir5v.", description_head: "I willfully decide to live in a world full of hope and promise even though sometimes REALITY may say otherwise. I often think of crazy imagined places in my mind where social issues\tare exaggerated or just physically manifested.I have an active imagination. :)\r\nI think I could effectively change the world for the better if I had the authority and it didn't change me. I would remove all currency from being legally recognized and let the rest do its self. :) I know it sounds crazy but think about it.", location_id: 25},
