  {name: "Norma Hickle", email: "harold@veum.com", session_token: "ykTWOnEhI2n0A6mTOpESBg", password_digest: "$2a$10$utGHWPyPLEiwxBeyOTVRxeDL1NwE1uLObd9h5G2sGptoh7I2ppMqK", description_head: "I am a student outside of Chattanooga Tennessee, though I live in New Jersey on breaks and summers. Just last year I spent the year in the middle of the Pacific ocean in Micronesia on a little island called Pohnpei where I was taught how to properly spear fish and coconut tree climb to get a good meal.\r\nBeing back in school, a slight damper has been put on my travels, but looking forward to working with a summer camp system in Alaska that will cover 3 different areas of what I hear to be a beautiful state.", location_id: 9},
  {name: "Erich Bednar III", email: "madisyn@lehner.name", session_token: "zKx1hPx3-Ic23m_sGNWqyg", password_digest: "$2a$10$MY8kkkL4cywTxFMsVNjlVuvmg3jPAyGgDjvF6WBhb9TkziRwEtlcC", description_head: "I LOVE FASHION art , photography and just living life im easy to get along with and i want more culture and looking to travel from here to live in new york its a big change but im willing to work!!!!! i love smallville kind of a nerd. lol And i love meeting new people making friends and enjoying my youth.!!", location_id: 10},
  {name: "Amari Kerluke Sr.", email: "monty.gibson@jonesgleason.info", session_token: "nrPTXe1UjtkUcQat4XxSwA", password_digest: "$2a$10$7s8phIEOALlV3hrDmUhbCec.OB.WkexrSC/Nqk4F.Fg53QI7ZjESS", description_head: "Hello everyone! I just moved here from Tokyo. I'm a designer tech entrepreneur. I'm also a travel banana, secret samurai, huge lushie, apprentice photographer, weekend fashion designer, hardcore English learner, healthy food enthusiast, occasionally musician, studied little bit of law in collage, learnt a lot things after school. Yeah my world is still expanding as everyone does. So I am center of the world. But you are also center of the world. So is everyone, so is no one.\r\nI believe science and begging of the universe and its eternity. But hey, what if there is no begging? I'm not afraid.", location_id: 12},
  {name: "Leta Sanford Jr.", email: "scotty_zboncak@harris.biz", session_token: "3FKfr8ZwOsmxt0ryGbsFgQ", password_digest: "$2a$10$ARoqZxtBURncDkPHapEqde.XkraiGrGrA0uuNemWMwQOAp7Y119k6", description_head: "When I am old I do not want to look back and say: What a boring life... Though after some age I think there comes a need to commit yourself to something. I think I am rather tolerant and open-minded though I will not go out of my way to make friends with everybody.\r\nI greatly appreciate sense of humor. I am not very talkative, though I like discussions about things that matter in life (whatever that means), with a glass of red wine :)", location_id: 14},
  {name: "Karson King", email: "darius@johns.net", session_token: "zMl1CwHyzdmBnX1w8hqkxQ", password_digest: "$2a$10$2hiwNnxmhJci2U5acbOcFOf64Jv8b/NyPfRcDtNC.q4sOx.fvkXKy", description_head: "I am very active and health conscious. I swim almost every day, get around by bike (don't own a car---or a TV for that matter), do yoga daily. I am pretty outgoing and social, like to cook, love movies, art and music and to travel. I am also fairly politically active, particularly with the bicycle community and with other local San Francisco stuff. As I am originally from the Midwest, I tend to be pretty straight forward, dependable, respectful and honest. But I can also be adventurous and mischievous.", location_id: 13},
  {name: "Miss Jo Langworth", email: "crystel@kutchlangworth.net", session_token: "8DehSjM2rCcMqSLctysT5Q", password_digest: "$2a$10$ZIFn/iIWYlb.UrB4vvhAYuIuRgtuUVLWRHQEU/on1WntTkCzQ6ay2", description_head: "Simply put, I like to have fun and hang out. I'm not a big fan of clubs or other places you can't hear yourself think. I got lucky and found a great house/roommate to live with\tso I've been enjoying the local hiking trails and other similar things. I'm always looking for that new adventure.\r\nBetween eating a bad meal and having a good experience and eating a good meal at a bad experience I will always go for the former; thats why I never try the same thing on the menu twice. Except for chile rieno's because they are so awesome. I have a fondness for cooking and the occasional nerdy boardgame.", location_id: 21},
