Event.create!([
  {organizer_id: 6, title: "Bike trip around the city or to Sausalito", description: "Hello!\r\n\r\nI'm Yvonne, Chinese lady from Singapore ( and no singpore is not a part of China or Japan!) haha\r\nI will be in SF for a week and staying with a local friend. I'm arriving on 23rd Aug and looking to do a bike trip around the city for a day on 24th a Aug. I would also like to visit Sausalito. I'm open to do other sightseeing too. \r\nDates are not firmly fixed but ideally would like go on a bike tour on 24th. Drop me a text and we can discuss :)\r\n\r\nCiao! \r\nYvonne", start_time: "2015-08-25 00:00:00", end_time: "2015-09-06 00:00:00", spots: 5, location_id: 20},
  {organizer_id: 24, title: "Tuesday Picnic ~ Île de la Cité", description: "TUESDAY \"PICNIC du JOUR\"\r\n\r\nSQUARE du VERT-GALANT\r\n\r\nOn the point of Île de la Cité under the Pont Neuf. Enter behind the statue of Henry IV.\r\n\r\nStart and End times only indicate when the Picnic du Jour begins and how long someone will wait for others to attend. The ending time of a picnic always varies.", start_time: "2015-08-26 06:00:00", end_time: "2015-08-25 21:00:00", spots: 10, location_id: 41},
  {organizer_id: 1, title: "Capstone Project Presentations", description: "On the 10th, me and all of my classmates will be presenting our capstone projects! Come take a look!\r\nAnd please give me a job!", start_time: "2015-09-10 22:00:00", end_time: "2015-09-11 01:00:00", spots: nil, location_id: 1},
  {organizer_id: 5, title: "CS Language Exchange - intercambio de idiomas", description: "Todos los martes hacemos un gran intercambio de idiomas en La Villa bar en la zona rosa. El evento no tiene ningún costo y todos de CS pueden entrar gratis, todos los idiomas son bienvenidos! Ademas no hay obligación de consumir durante el evento y ofrecemos agua con hielo sin costo tambien para la gente de CS. Es un ambiente muy informal con grupos organizados, con por lo menos un hablante nativo por cada grupo. Después tenemos una fiesta super chévere hasta las 3 de la mañana! *Para las personas que están dentro del sitio antes de las 9:00 p.m. pueden quedarse sin costo, pero aquellas que llegan después de esta hora recordamos que hay cover de $15.000.*\r\n\r\n--------------------------------------------------------------------------------------------------------\r\n\r\nEvery Tuesday we host a free language exchange in La Villa bar in the zona rosa. There is no cost for CS members to enter and all languages are welcome. There is also no obligation to consume anything during the event and there is iced water provided for members of CS that prefer not to consume alcohol. It is an informal environment with organized groups, the idea being to have at least one native speaker per group. After the language exchange we have an awesome party until 3 in the morning. *If you are inside the bar before 9pm you can stay for the party without paying cover. For those that come after 9pm just for the party, there is a cover of $15,000*", start_time: "2015-08-29 00:00:00", end_time: "2015-08-29 01:00:00", spots: 120, location_id: 15},
  {organizer_id: 15, title: "Let me borrow all your dogs", description: "Basically I need a lot of dog to scare the crap out of some guy in san jose. Come one, come all! Bring your dogs tho", start_time: "2015-08-26 20:00:00", end_time: "2015-08-27 00:00:00", spots: 11, location_id: 29},
  {organizer_id: 21, title: "Photography meetup", description: "I want to meet up and talk about how superior black and white photographs are to the normal kind", start_time: "2015-08-26 00:00:00", end_time: nil, spots: 9, location_id: 37},
  {organizer_id: 12, title: "Rodeo", description: "I want to go to the rodeo, but I dont have any friends and it would be weird to go alone. so go with me pls", start_time: "2015-08-28 04:00:00", end_time: nil, spots: 12, location_id: 26},
  {organizer_id: 20, title: "Pub Crawl with International Travelers", description: "Hi everyone - There's a pub crawl run by volunteers at hostels in SF so that there's a place for backpackers and locals to meet each other. The event gets a bunch of travelers from all over the city along with locals. Usually there are about 50-60 backpackers that attend who are staying at hostels around SF. During the crawl, everyone competes in a rock-paper-scissors tournament as we move from bar-to-bar so that it's easy to approach/meet new people.\r\n\r\nCome join us, have some drinks, and make some new international friends for the night. We get drink specials ($3 beers/spirits & $2 shots), and there is a $5 drink minimum per person for the night (this can be non-alcoholic) because the venues open and staff the bars just for our group.", start_time: "2015-08-29 05:00:00", end_time: "2015-09-30 11:00:00", spots: nil, location_id: 35},
  {organizer_id: 29, title: "Drinking", description: "Lets all sit on the beach and drink and stare at the water...", start_time: "2015-08-29 00:00:00", end_time: "2015-08-29 01:00:00", spots: 10, location_id: 48},
  {organizer_id: 4, title: "Roadtrip - San Francisco > Yosimete > Grand Canyon", description: "we plan to go from san francisco to yosemite and as far as we get to grand canyon and would definitely like to share this trip with some of you guys! we are really flexible about the day of departure, the date and the place of the ending and the route aswell, so just let us know, if you're interested in joining us. unfortunately we don't have a car, but i have a driving license, so we could rent one (i would be happy if there is another one with license coming with us because leo, the friend of mine who's traveling with me, has none). \r\nwe are two students from germany, on a two month trip through the U.S., willing to explore as much as we can within that time. so even if you know some places that will make our route somehow more interesting, let us know! \r\nwe're excited to hear from you and hopefully to share this trip with you!!! ", start_time: "2015-08-31 17:00:00", end_time: "2015-09-08 00:00:00", spots: 5, location_id: 13},
